import React from "react";
import axios from "axios";

class BoardMap extends React.Component {
  componentDidMount() {
    axios.get("http://localhost:8000/api/").then(res => {
      console.log(res.data);
      alert("ok");
    });
  }

  render() {
    return <div className="boardmap" />;
  }
}

export default BoardMap;
